import { useState } from "react";

const Prueba = () => {
  const [dato, setDato] = useState("");
  function probar() {
    setDato(
      <iframe
        title="Proyecto_k"
        width="560"
        height="315"
        src="https://www.youtube.com/embed/tHW2aOuaXBA?controls=0"
        frameborder="0"
        allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
        allowfullscreen
      ></iframe>
    );
  }

  return <div>{probar}</div>;
};

export default Prueba;
